import React, { useEffect, useState } from "react";

interface Applicant {
  name: string;
  course: string;
  availability: string;
  skills: string;
  credentials: string;
}

interface Selected {
  name: string;
  comment: string;
  rank: number;
}

const LecturerPanel = () => {
  const [applicants, setApplicants] = useState<Applicant[]>([]);
  const [selected, setSelected] = useState<Selected[]>([]);

  useEffect(() => {
    // 从 localStorage 中加载已提交的导师申请信息
    const stored = localStorage.getItem("tutorApplication");
    if (stored) {
      const data = JSON.parse(stored);
      const formatted: Applicant = {
        name: "Test User", // 模拟用户姓名
        course: data.selectedCourses.join(", "),
        availability: data.availability,
        skills: data.skills,
        credentials: data.credentials
      };
      setApplicants([formatted]);
    }
  }, []);

  const toggleSelect = (name: string) => {
    if (selected.find(sel => sel.name === name)) {
      setSelected(prev => prev.filter(sel => sel.name !== name));
    } else {
      setSelected(prev => [...prev, { name, comment: "", rank: prev.length + 1 }]);
    }
  };

  const updateComment = (name: string, comment: string) => {
    setSelected(prev =>
      prev.map(sel =>
        sel.name === name ? { ...sel, comment } : sel
      )
    );
  };

  const updateRank = (name: string, rank: number) => {
    setSelected(prev =>
      prev.map(sel =>
        sel.name === name ? { ...sel, rank } : sel
      )
    );
  };

  return (
    <div className="p-6 max-w-5xl mx-auto mt-6">
      <h2 className="text-2xl font-bold mb-4 text-center">教师评选界面</h2>

      {applicants.length === 0 ? (
        <p className="text-center text-gray-600">暂无申请人数据。</p>
      ) : (
        <ul className="space-y-4">
          {applicants.map((app, idx) => {
            const isSelected = selected.some(sel => sel.name === app.name);
            const selData = selected.find(sel => sel.name === app.name);
            return (
              <li key={idx} className="border p-4 rounded shadow">
                <p><strong>姓名：</strong>{app.name}</p>
                <p><strong>课程：</strong>{app.course}</p>
                <p><strong>可用性：</strong>{app.availability}</p>
                <p><strong>技能：</strong>{app.skills}</p>
                <p><strong>学历：</strong>{app.credentials}</p>

                <div className="mt-4">
                  <label className="mr-4">
                    <input
                      type="checkbox"
                      checked={isSelected}
                      onChange={() => toggleSelect(app.name)}
                    />
                    {" "}选择候选人
                  </label>
                </div>

                {isSelected && (
                  <div className="mt-3 space-y-2">
                    <div>
                      <label className="block font-semibold mb-1">评语：</label>
                      <textarea
                        className="w-full border p-2 rounded"
                        value={selData?.comment || ""}
                        onChange={(e) => updateComment(app.name, e.target.value)}
                      />
                    </div>
                    <div>
                      <label className="block font-semibold mb-1">排序优先级（1-5）：</label>
                      <input
                        type="number"
                        min={1}
                        max={5}
                        className="border p-2 rounded w-24"
                        value={selData?.rank || 1}
                        onChange={(e) => updateRank(app.name, parseInt(e.target.value))}
                      />
                    </div>
                  </div>
                )}
              </li>
            );
          })}
        </ul>
      )}
    </div>
  );
};

export default LecturerPanel;
